CREATE FUNCTION ol_gran_ins() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  x1 NUMERIC;
  y1 NUMERIC;
  x2 NUMERIC;
  y2 NUMERIC;
  dl NUMERIC;
  di NUMERIC;
  gr NUMERIC;
  mi NUMERIC;
  idu INTEGER;
  ngeom geometry;
  idg INTEGER;
BEGIN
  IF ST_IsValid(NEW.geom) THEN
    x1 = st_x(st_pointn(NEW.geom, 1));
    y1 = st_y(st_pointn(NEW.geom, 1));
    x2 = st_x(st_pointn(NEW.geom, 2));
    y2 = st_y(st_pointn(NEW.geom, 2));
    dl = sqrt((x2-x1)^2 + (y2-y1)^2);
--    dl = st_length(NEW.geom);

    IF x2 > x1 THEN
      di = degrees(asin((y1-y2)/dl)) + 90;
    ELSE
      di = degrees(asin((y2-y1)/dl)) + 270;
    END IF;
    gr = trunc(di);
    mi = trunc((di - gr) * 60);
    
    NEW.dlina = dl;
    NEW.gradusy = gr;
    NEW.minuty = mi;
  END IF;

  idu = NEW.id_uchastok;
  ngeom = NEW.geom;

  SELECT id FROM "msk".granica WHERE (id_uchastok = idu) AND (public.st_equals(ngeom, geom)) INTO idg;
  IF (idg > 0) THEN
    RETURN NULL;
  ELSE
    RETURN NEW;
  END IF;  
  
END;
$$;


