-- TOC entry 1303 (class 1255 OID 18949)
-- Name: ol_toch_ins(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION ol_toch_ins() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  idu INTEGER;
  ngeom geometry;
  idt INTEGER;
  pob INTEGER;
  idparent INTEGER;
  maxnomer INTEGER;
  part SMALLINT;

BEGIN
  idu   = NEW.id_uchastok;
  ngeom = NEW.geom;
  pob   = NEW.poryadok_obhoda;
  part  = NEW.nomer_chasti;
-- проверка существования точки у данного ЗУ с такой же геометрией
-- если есть такая точка, тогда только меняется порядок обхода, но INSERT NEW не происходит
  SELECT id FROM msk.tochka WHERE (id_uchastok = idu) AND (public.st_equals(ngeom, geom)) INTO idt;

  IF (idt > 0) THEN
    IF (pob > 0) THEN
--      UPDATE msk.tochka SET poryadok_obhoda = pob WHERE id = idt;
      UPDATE msk.tochka SET (poryadok_obhoda, nomer_chasti) = (pob, part) WHERE id = idt;
    END IF;
    RETURN NULL;
    
  ELSE
-- для новых точек корректируем нумерацию  
    IF NEW.prefiks_nomera = 'н' THEN
      SELECT id_parent FROM public.parcel_parcel WHERE id_children = idu INTO idparent;

      IF (idparent IS NOT NULL) THEN
        SELECT MAX(nomer) FROM msk.tochka 
          WHERE id_uchastok IN (SELECT id_children FROM public.parcel_parcel WHERE (id_parent = idparent))
            AND (prefiks_nomera = 'н') INTO maxnomer;
      ELSE
        SELECT MAX(nomer) FROM msk.tochka WHERE (id_uchastok = idu) AND (prefiks_nomera = 'н') INTO maxnomer;
      END IF;  
      
      IF (maxnomer IS NULL) THEN
        NEW.nomer = 1;
      ELSE
        NEW.nomer = maxnomer + 1;
      END IF;
    END IF;  

    RETURN NEW;

  END IF;  
  
END;
$$;


