--
-- TOC entry 1296 (class 1255 OID 18950)
-- Name: ol_toch_ins_after(); Type: FUNCTION; Schema: public; Owner: openlandadmin
--

CREATE FUNCTION ol_toch_ins_after() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  idu INTEGER;
  idmsk VARCHAR;
  ngeom geometry;
  idt INTEGER;
  pgeom geometry;
  n INTEGER;
  p CHAR;
  sposob CHAR;
BEGIN
  idt = NEW.id;
  idu = NEW.id_uchastok;
  ngeom = NEW.geom;

  INSERT INTO public.granica_tochka (id_tochka, id_granica) 
    SELECT idt, id FROM msk.granica WHERE id_uchastok=idu
      AND public.st_intersects(ngeom, geom);
   
-- если уже существует точка с такой геометрией, тогда номер и префикс берётся от существующей
-- если образование ЗУ из земель госсобственности - тогда все точки новые
-- если раздел ЗУ - тогда все совпадающие новые точки с одинаковым номером
  IF (idt IS NOT NULL) THEN
    pgeom = NEW.geom;
    SELECT nomer, prefiks_nomera FROM msk.tochka 
        WHERE (id <> idt) 
            AND pre = 0
            AND (public.st_equals(pgeom, geom)) 
        INTO n, p;
    
    IF (n > 0) THEN
      SELECT id_sposob_obrazovaniya FROM msk.uchastok WHERE id = idu INTO sposob;
      
      IF (p = 'н') THEN
        IF (sposob IN ('2', '3', '4')) THEN
          UPDATE msk.tochka SET (nomer, prefiks_nomera) = (n, p) Where id = idt;
        END IF;    
      
      ELSE
        IF (sposob IS NOT NULL) AND (sposob <> '5') THEN
          UPDATE msk.tochka SET (nomer, prefiks_nomera) = (n, p) Where id = idt;
          
        END IF;    
      END IF;
    END IF; 
    
-- если точка новая, границы с её участием становятся красными    
    SELECT prefiks_nomera FROM msk.tochka WHERE id = idt INTO p;
    IF p = 'н' THEN
      UPDATE msk.granica SET uslovnyy_znak = 1 WHERE id IN
        (SELECT id_granica FROM public.granica_tochka WHERE id_tochka = idt);
    END IF;    
     
  END IF;  

-- добавим новую точку в таблицу уникальных точек
  BEGIN
    INSERT INTO msk.tochka_uni 
      SELECT id, id_uchastok, nomer, prefiks_nomera, geom, 
             podpis_x, podpis_y, uslovnyy_znak, id_msk, pre
        FROM msk.tochka
        WHERE id = idt;
  
  EXCEPTION WHEN OTHERS THEN
    -- nothing
  END;          
  
  RETURN NEW;
END;
$$;


