--
-- TOC entry 1297 (class 1255 OID 18951)
-- Name: ol_toch_upd(); Type: FUNCTION; Schema: public; Owner: openlandadmin
--

CREATE FUNCTION ol_toch_upd() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  x NUMERIC;
  y NUMERIC;
  idt INTEGER;
  
BEGIN
  IF ST_IsValid(NEW.geom) THEN
    x = st_y(NEW.geom);
    y = st_x(NEW.geom);
    IF (NEW.x <> x) THEN NEW.x = x; END IF;
    IF (NEW.y <> y) THEN NEW.y = y; END IF;
  END IF;
  NEW.create_user = OLD.create_user;
  NEW.create_date = OLD.create_date;
  NEW.update_user = current_user;
  NEW.update_date = current_timestamp;

  idt = NEW.id;
-- если точка с префиксом н, тогда граница становится красной
  IF NEW.prefiks_nomera = 'н' THEN
    UPDATE msk.granica SET uslovnyy_znak = 1 WHERE id IN
      (SELECT id_granica FROM public.granica_tochka WHERE id_tochka = idt);
  END IF;
-- если точка прекращает существование, тогда граница тоже
  IF NEW.pre = 1 THEN
    UPDATE msk.granica SET pre = 1 
      WHERE id IN
        (SELECT id_granica FROM public.granica_tochka WHERE id_tochka = idt);
  END IF;    

  RETURN NEW;
END;
$$;


