-- Name: ol_uch_ins_after(); Type: FUNCTION; Schema: public; Owner: openlandadmin
--

CREATE FUNCTION ol_uch_ins_after() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  idu INTEGER;
  idk CHAR(12);
  ar NUMERIC;
  k NUMERIC;
  po NUMERIC(10, 0);
BEGIN
  IF ST_IsValid(NEW.geom) THEN
    idu = NEW.id;
    idk = NEW.id_kategoriya;
    ar = st_area2d(NEW.geom);
    
    IF idk = '003002000000' THEN k = 0.1;
    ELSEIF idk = '003001000000' THEN k = 2.5;
    ELSEIF idk = '003003000000' THEN k = 0.5;
    ELSEIF idk = '003004000000' THEN k = 2.5;
    ELSEIF idk = '003005000000' THEN k = 5.0;
    ELSEIF idk = '003006000000' THEN k = 5.0;
    ELSEIF idk = '003007000000' THEN k = 5.0;
    ELSEIF idk = '003008000000' THEN k = 2.5;
    ELSE k = 0;
    END IF;
    
    po = sqrt(ar) * 3.5 * k;
    INSERT 
      INTO public.ploshad 
        (id_uchastok, id_vid_ploshadi, ploshad, id_edinicy_izmereniya, pogreshnost_izmereniya)
        VALUES
        (idu, '009', ar, '055', po);
  END IF;  
  RETURN NEW;
END;
$$;


